import React from "react";
import Footer from "./Footer";
import Header from "./Header";
import Note from "./Note";


function App() {
    return <div>
        <Header />
        <Create Area/>
        <Note
            key = {1}
            title = {"pupa"}
            content = {"tryk tryk"}
            />
        <Footer />
        </div>
    ;
}
export default App;
